// Funciones auxiliares para trabajar con los datos

/**
 * Obtener todos los niños
 * @returns {Array} Array con todos los registros
 */
function obtenerTodosNinos() {
  return SEGUIMIENTO_CRED;
}

/**
 * Buscar niño por DNI
 * @param {string|number} dni - DNI del niño
 * @returns {Object|null} Registro del niño o null si no existe
 */
function buscarPorDNI(dni) {
  return SEGUIMIENTO_CRED.find(n => n.N_DNI_HIS == dni) || null;
}

/**
 * Buscar niño por HC (Historia Clínica)
 * @param {string|number} hc - Número de historia clínica
 * @returns {Object|null} Registro del niño o null si no existe
 */
function buscarPorHC(hc) {
  return SEGUIMIENTO_CRED.find(n => n.HC == hc) || null;
}

/**
 * Buscar niños por nombre (búsqueda parcial)
 * @param {string} nombre - Nombre o parte del nombre
 * @returns {Array} Array con niños que coinciden
 */
function buscarPorNombre(nombre) {
  const nombreUpper = nombre.toUpperCase();
  return SEGUIMIENTO_CRED.filter(n => 
    n.Nombres_P && n.Nombres_P.toUpperCase().includes(nombreUpper)
  );
}

/**
 * Filtrar niños por IPRESS
 * @param {string} ipress - Nombre del IPRESS
 * @returns {Array} Array con niños del IPRESS especificado
 */
function filtrarPorIPRESS(ipress) {
  return SEGUIMIENTO_CRED.filter(n => n.IPRESS_HIS === ipress);
}

/**
 * Obtener lista única de IPRESS
 * @returns {Array} Array con nombres de IPRESS únicos
 */
function obtenerIPRESS() {
  const ipress = new Set();
  SEGUIMIENTO_CRED.forEach(n => {
    if (n.IPRESS_HIS) ipress.add(n.IPRESS_HIS);
  });
  return Array.from(ipress).sort();
}

/**
 * Contar controles CRED realizados
 * @param {Object} nino - Objeto niño
 * @returns {number} Cantidad de controles CRED
 */
function contarControlesCRED(nino) {
  let count = 0;
  // Controles de recién nacido
  for (let i = 1; i <= 4; i++) {
    if (nino[`CREDRN_${i}`]) count++;
  }
  // Controles regulares
  for (let i = 1; i <= 11; i++) {
    if (nino[`CRED_${i}`]) count++;
  }
  return count;
}

/**
 * Obtener niños con controles incompletos
 * @param {number} minControles - Número mínimo de controles esperados
 * @returns {Array} Array con niños que tienen menos controles
 */
function ninosConControlesIncompletos(minControles = 5) {
  return SEGUIMIENTO_CRED.filter(n => contarControlesCRED(n) < minControles);
}

/**
 * Obtener último dosaje de hemoglobina
 * @param {Object} nino - Objeto niño
 * @returns {number|null} Valor de última hemoglobina o null
 */
function ultimoDosajeHemoglobina(nino) {
  for (let i = 11; i >= 6; i--) {
    const hb = nino[`DOSAJE_${i}M_SF`];
    if (hb && hb > 0) return hb;
  }
  return null;
}

/**
 * Identificar niños con anemia (HB < 11)
 * @returns {Array} Array con niños con anemia
 */
function ninosConAnemia() {
  return SEGUIMIENTO_CRED.filter(n => {
    const hb = ultimoDosajeHemoglobina(n);
    return hb !== null && hb < 11;
  });
}

/**
 * Obtener historial de controles CRED
 * @param {Object} nino - Objeto niño
 * @returns {Array} Array con objetos de controles
 */
function obtenerHistorialControles(nino) {
  const controles = [];
  
  // Controles de recién nacido
  for (let i = 1; i <= 4; i++) {
    const fecha = nino[`CREDRN_${i}`];
    if (fecha) {
      controles.push({
        tipo: 'Recién Nacido',
        numero: i,
        fecha: fecha,
        peso: nino[`PESO_${i}RN`] || null,
        talla: nino[`TALLA_${i}RN`] || null,
        atendio: nino[`ATENDIO_${i}RN`] || 'No registrado'
      });
    }
  }
  
  // Controles regulares
  for (let i = 1; i <= 11; i++) {
    const fecha = nino[`CRED_${i}`];
    if (fecha && fecha !== '' && fecha !== '0') {
      controles.push({
        tipo: 'CRED',
        numero: i,
        fecha: fecha,
        peso: nino[`PESO_${i}`] || null,
        talla: nino[`TALLA_${i}`] || null,
        atendio: nino[`ATENDIO_${i}`] || 'No registrado'
      });
    }
  }
  
  return controles;
}

/**
 * Obtener historial de suplementación
 * @param {Object} nino - Objeto niño
 * @returns {Object} Objeto con suplementación por mes y tipo
 */
function obtenerHistorialSuplementacion(nino) {
  const suplementacion = [];
  
  for (let mes = 4; mes <= 11; mes++) {
    const registro = {};
    let tieneDatos = false;
    
    // Sulfato Ferroso (SF)
    if (nino[`SUP_${mes}M_SF`]) {
      registro.mes = mes;
      registro.tipo = 'Sulfato Ferroso';
      registro.fecha = nino[`SUP_${mes}M_SF`];
      registro.dosaje = nino[`DOSAJE_${mes}M_SF`] || null;
      registro.atendio = nino[`ATENDIO_${mes}M_SF`] || null;
      tieneDatos = true;
      suplementacion.push({...registro});
    }
    
    // Polvo (P0)
    if (nino[`SUP_${mes}M_P0`]) {
      registro.mes = mes;
      registro.tipo = 'Polvo';
      registro.fecha = nino[`SUP_${mes}M_P0`];
      registro.dosaje = nino[`DOSAJE_${mes}M_P0`] || null;
      registro.atendio = nino[`ATENDIO_${mes}M_P0`] || null;
      tieneDatos = true;
      suplementacion.push({...registro});
    }
    
    // Micronutrientes (MN)
    if (nino[`SUP_${mes}M_MN`]) {
      registro.mes = mes;
      registro.tipo = 'Micronutrientes';
      registro.fecha = nino[`SUP_${mes}M_MN`];
      registro.dosaje = nino[`DOSAJE_${mes}M_MN`] || null;
      registro.atendio = nino[`ATENDIO_${mes}M_MN`] || null;
      tieneDatos = true;
      suplementacion.push({...registro});
    }
  }
  
  return suplementacion;
}

/**
 * Filtrar niños por rango de edad (en meses)
 * @param {number} edadMin - Edad mínima en meses
 * @param {number} edadMax - Edad máxima en meses
 * @returns {Array} Array con niños en el rango
 */
function filtrarPorEdad(edadMin, edadMax) {
  return SEGUIMIENTO_CRED.filter(n => 
    n.Edad >= edadMin && n.Edad <= edadMax
  );
}

/**
 * Obtener niños por dirección (búsqueda parcial)
 * @param {string} direccion - Dirección o parte de la dirección
 * @returns {Array} Array con niños que coinciden
 */
function buscarPorDireccion(direccion) {
  const direccionUpper = direccion.toUpperCase();
  return SEGUIMIENTO_CRED.filter(n => 
    n.Direccion && n.Direccion.toUpperCase().includes(direccionUpper)
  );
}

/**
 * Estadísticas generales
 * @returns {Object} Objeto con estadísticas del sistema
 */
function obtenerEstadisticas() {
  const total = SEGUIMIENTO_CRED.length;
  const conAnemia = ninosConAnemia().length;
  const controlesIncompletos = ninosConControlesIncompletos(5).length;
  
  // Calcular edad promedio
  const edades = SEGUIMIENTO_CRED.map(n => n.Edad).filter(e => e > 0);
  const edadPromedio = edades.reduce((a, b) => a + b, 0) / edades.length;
  
  // Controles promedio
  const totalControles = SEGUIMIENTO_CRED.reduce((sum, n) => 
    sum + contarControlesCRED(n), 0
  );
  const controlesPromedio = totalControles / total;
  
  // Contar niños con suplementación
  let conSuplementacion = 0;
  SEGUIMIENTO_CRED.forEach(n => {
    const supl = obtenerHistorialSuplementacion(n);
    if (supl.length > 0) conSuplementacion++;
  });
  
  return {
    totalNinos: total,
    ninosConAnemia: conAnemia,
    porcentajeAnemia: ((conAnemia / total) * 100).toFixed(2) + '%',
    ninosConControlesIncompletos: controlesIncompletos,
    porcentajeControlesIncompletos: ((controlesIncompletos / total) * 100).toFixed(2) + '%',
    edadPromedioMeses: edadPromedio.toFixed(1),
    controlesPromedio: controlesPromedio.toFixed(1),
    ninosConSuplementacion: conSuplementacion,
    porcentajeSuplementacion: ((conSuplementacion / total) * 100).toFixed(2) + '%',
    totalIPRESS: obtenerIPRESS().length
  };
}

